import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import { SCORE_RANGES } from '../utils/types';

const AssessmentDashboard = ({ assessmentHistory }) => {
  const getScoreRange = (score) => {
    return Object.values(SCORE_RANGES).find(
      (range) => score >= range.min && score <= range.max
    );
  };

  const calculateAverageScore = () => {
    if (assessmentHistory.length === 0) return 0;
    const total = assessmentHistory.reduce((sum, assessment) => sum + assessment.score, 0);
    return Math.round(total / assessmentHistory.length);
  };

  const getRecentAssessments = () => {
    return assessmentHistory
      .sort((a, b) => new Date(b.completedAt) - new Date(a.completedAt))
      .slice(0, 5);
  };

  const averageScore = calculateAverageScore();
  const recentAssessments = getRecentAssessments();
  const scoreRange = getScoreRange(averageScore);

  return (
    <div className="space-y-6">
      {/* Overview Cards */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="bg-white shadow rounded-lg p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Average Score</h3>
          <p className="text-3xl font-bold text-gray-900">{averageScore}%</p>
          <div className={`mt-2 px-3 py-1 rounded-full bg-${scoreRange.color}-100 inline-block`}>
            <span className={`text-${scoreRange.color}-800 text-sm font-medium`}>
              {scoreRange.label}
            </span>
          </div>
        </div>

        <div className="bg-white shadow rounded-lg p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Total Assessments</h3>
          <p className="text-3xl font-bold text-gray-900">{assessmentHistory.length}</p>
          <p className="mt-2 text-sm text-gray-600">Completed assessments</p>
        </div>

        <div className="bg-white shadow rounded-lg p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Passing Rate</h3>
          <p className="text-3xl font-bold text-gray-900">
            {Math.round(
              (assessmentHistory.filter((a) => a.score >= 70).length /
                assessmentHistory.length) *
                100
            )}%
          </p>
          <p className="mt-2 text-sm text-gray-600">Success rate</p>
        </div>
      </div>

      {/* Recent Assessments */}
      <div className="bg-white shadow rounded-lg p-6">
        <div className="flex items-center justify-between mb-4">
          <h3 className="text-lg font-medium text-gray-900">Recent Assessments</h3>
          <Link
            to="/assessments/history"
            className="text-sm font-medium text-blue-600 hover:text-blue-500"
          >
            View all
          </Link>
        </div>
        <div className="space-y-4">
          {recentAssessments.map((assessment) => {
            const assessmentScoreRange = getScoreRange(assessment.score);
            return (
              <div
                key={assessment.id}
                className="flex items-center justify-between p-4 border rounded-lg"
              >
                <div>
                  <h4 className="font-medium text-gray-900">{assessment.title}</h4>
                  <p className="text-sm text-gray-600">
                    Completed on {new Date(assessment.completedAt).toLocaleDateString()}
                  </p>
                </div>
                <div className="flex items-center space-x-4">
                  <div className={`px-3 py-1 rounded-full bg-${assessmentScoreRange.color}-100`}>
                    <span className={`text-${assessmentScoreRange.color}-800 text-sm font-medium`}>
                      {assessment.score}%
                    </span>
                  </div>
                  <Link
                    to={`/assessments/${assessment.id}/result`}
                    className="text-sm font-medium text-blue-600 hover:text-blue-500"
                  >
                    View Details
                  </Link>
                </div>
              </div>
            );
          })}
        </div>
      </div>

      {/* Progress Chart Placeholder */}
      <div className="bg-white shadow rounded-lg p-6">
        <h3 className="text-lg font-medium text-gray-900 mb-4">Progress Over Time</h3>
        <div className="h-64 flex items-center justify-center text-gray-500">
          Chart visualization will be implemented here
        </div>
      </div>
    </div>
  );
};

AssessmentDashboard.propTypes = {
  assessmentHistory: PropTypes.arrayOf(
    PropTypes.shape({
      id: PropTypes.string.isRequired,
      title: PropTypes.string.isRequired,
      score: PropTypes.number.isRequired,
      completedAt: PropTypes.string.isRequired
    })
  ).isRequired
};

export default AssessmentDashboard;
